function addTimePath() {
    var len = timePaths.length;
    for (var i = 0; i < len; i++) {
        timePaths[i].setMap(map);
    }
}

function removeTimePath() {
    var len = timePaths.length;
    for (var i = 0; i < len; i++) {
        timePaths[i].setMap(null);
    }
}

// Sets the map on all POIs in the array.
function setAllPOIs(map) {
    for (var i = 0; i < pois.length; i++) {
        pois[i].setMap(map);
    }
}

// Removes the pois from the map, but keeps them in the array.
function clearPOIs() {
    setAllPOIs(null);
}

// Shows any POIs currently in the array.
function showPOIs() {
    setAllPOIs(map);
}

// Sets the map on all markers in the array.
function setAllMarkers(map) {
    for (var i = 0; i < markers.length; i++) {
        markers[i].setMap(map);
    }
}

// Removes the markers from the map, but keeps them in the array.
function clearMarkers() {
    setAllMarkers(null);
}

// Shows any markers currently in the array.
function showMarkers() {
    setAllMarkers(map);
}

google.maps.event.addDomListener(window, 'load', initialize);
